  {
   "cell_type": "markdown",
   "id": "8a6dbfb5-ec85-47de-b877-dd20cf765152",
   "metadata": {},
   "source": [
    "### Créer la fonction du modèle (CNN + BiLSTM + Attention)"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 35,
   "id": "5cbdd02d-98a6-41c0-abb1-1e0068e3e47b",
   "metadata": {},
   "outputs": [],
   "source": [
    "from tensorflow.keras.models import Model\n",
    "from tensorflow.keras.layers import Input, Conv1D, MaxPooling1D, Bidirectional, LSTM, Dense, Dropout, Multiply, Flatten\n",
    "from tensorflow.keras.optimizers import Adam\n",
    "\n",
    "def attention_layer(inputs):\n",
    "    attention_weights = Dense(1, activation='tanh')(inputs)\n",
    "    attention_weights = Flatten()(attention_weights)\n",
    "    attention_weights = Dense(inputs.shape[1], activation='softmax')(attention_weights)\n",
    "    attention_weights = RepeatVector(inputs.shape[2])(attention_weights)\n",
    "    attention_weights = Permute([2, 1])(attention_weights)\n",
    "    return Multiply()([inputs, attention_weights])\n",
    "\n",
    "def build_model(input_shape):\n",
    "    inputs = Input(shape=input_shape)\n",
    "    x = Conv1D(64, 5, activation='relu')(inputs)\n",
    "    x = MaxPooling1D(2)(x)\n",
    "    x = Bidirectional(LSTM(64, return_sequences=True))(x)\n",
    "    x = attention_layer(x)\n",
    "    x = Flatten()(x)\n",
    "    x = Dense(64, activation='relu')(x)\n",
    "    x = Dropout(0.3)(x)\n",
    "    outputs = Dense(1, activation='sigmoid')(x)\n",
    "\n",
    "    model = Model(inputs=inputs, outputs=outputs)\n",
    "    model.compile(optimizer=Adam(0.001), loss='binary_crossentropy', metrics=['accuracy'])\n",
    "    return model\n"
   ]
  },
  {
   "cell_type": "markdown",
   "id": "35993403-fdd1-4acf-9685-bc7b25115c9b",
   "metadata": {},
   "source": [
    "### 🔄  Création du modèle"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 37,
   "id": "4906b0be-da93-45be-ba0b-e8310793c53a",
   "metadata": {},
   "outputs": [],
   "source": [
    "from tensorflow.keras import layers, models\n",
    "\n",
    "def create_model():\n",
    "    input_layer = layers.Input(shape=(X.shape[1], X.shape[2]))  # adapte selon ton input\n",
    "\n",
    "    # CNN\n",
    "    x = layers.Conv1D(64, kernel_size=3, activation='relu')(input_layer)\n",
    "    x = layers.MaxPooling1D(pool_size=2)(x)\n",
    "\n",
    "    # BiLSTM\n",
    "    x = layers.Bidirectional(layers.LSTM(64, return_sequences=True))(x)\n",
    "\n",
    "    # Attention Mechanism (simple)\n",
    "    attention = layers.Dense(1, activation='tanh')(x)\n",
    "    attention = layers.Flatten()(attention)\n",
    "    attention = layers.Activation('softmax')(attention)\n",
    "    attention = layers.RepeatVector(128)(attention)\n",
    "    attention = layers.Permute([2, 1])(attention)\n",
    "    x = layers.multiply([x, attention])\n",
    "    x = layers.GlobalAveragePooling1D()(x)\n",
    "\n",
    "    # Output\n",
    "    output = layers.Dense(1, activation='sigmoid')(x)\n",
    "\n",
    "    model = models.Model(inputs=input_layer, outputs=output)\n",
    "    model.compile(optimizer='adam', loss='binary_crossentropy', metrics=['accuracy'])\n",
    "    return model\n"
   ]
  },
